import { createRouter, createWebHistory } from 'vue-router'
import HomeView from '../views/HomeView.vue'
import reade1srorieView from '../views/reade1srorieView.vue'
import AboutVieW from '../views/AboutVie.vue'

const routes = [
  {
    path: '/',
    name: 'home',
    component: HomeView
  },
  {
    path: '/about',
    name: 'about',
    component: AboutView

  },

  {
    path: '/reade1srorie',
    name: 'reade1srorie',
    component: reade1srorieView

  }
]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router
